import React from "react";
import {NavLink} from "react-router-dom";
import { withStyles } from "@material-ui/core/styles";

const styles = theme => ({
	root: {
	  display: "flex",
	  flexWrap: "wrap",
	  justifyContent: "space-around",
	  overflow: "hidden",
	  backgroundColor: theme.palette.background.paper,
	  marginTop: '100px'
	}
  });

