			<h1>This Page does not exists</h1>
			<NavLink to="/">Go Back</NavLink>
			<br></br>
			<br></br>
			This page does not exist... Please Go back to Home Page
		</div>
	);
};

export default withStyles(styles)(PageNotFound);
